import "../styles/celebrity.css"

const Celebrity = (prob) => {
    let celeb = prob.datas
    return (
        <div>
            {celeb.map((x)=>(
                <div className="container">
                    <div className="images" height="100px" w>
                    <img src={x.image} alt="" />
                    </div>
                    <div className="sentence">
                    <h1>{x.name}</h1>
                    </div>
                </div>
            ))}
        </div>


    );
}

export default Celebrity;
